import React, { useState } from "react";

const Questionnaire = () => {
  const [answers, setAnswers] = useState({});

  const handleChange = (event) => {
    setAnswers({ ...answers, [event.target.name]: event.target.value });
  };

  const handleSubmit = (event) => {
    event.preventDefault();
    // submit answers to backend API
    console.log(answers);
  };

  return (
    <form onSubmit={handleSubmit}>
      <div>
        <label htmlFor="location">Where do you live?</label>
        <select name="location" id="location" onChange={handleChange}>
          <option value="">Select an option</option>
          <option value="house">House</option>
          <option value="apartment">Apartment</option>
        </select>
      </div>
      <div>
        <label htmlFor="outdoor_space">
          How much outdoor space do you have?
        </label>
        <select name="outdoor_space" id="outdoor_space" onChange={handleChange}>
          <option value="">Select an option</option>
          <option value="none">None</option>
          <option value="small_garden">Small Garden</option>
          <option value="medium_garden">Medium Garden</option>
          <option value="large_garden">Large Garden</option>
        </select>
      </div>
      <div>
        <label htmlFor="children">
          Will there be any children in the household?
        </label>
        <select name="children" id="children" onChange={handleChange}>
          <option value="">Select an option</option>
          <option value="no">No, never ever</option>
          <option value="maybe_soon">Maybe soon...</option>
          <option value="under_12">I have kids under 12</option>
          <option value="over_12">I have kids over 12</option>
        </select>
      </div>
      {/* add more questions */}
      <button type="submit">Submit</button>
    </form>
  );
};

export default Questionnaire;
